            response:= (<-this.PrivatePostAuthWTransfer(this.Extend(request, params)))
            PanicOnError(response)
            //
            //     [
            //         1616451183763,
            //         "acc_tf",
            //         null,
            //         null,
            //         [
            //             1616451183763,
            //             "exchange",
            //             "margin",
            //             null,
            //             "UST",
            //             "UST",
            //             null,
            //             1
            //         ],
            //         null,
            //         "SUCCESS",
