    // on trading pairs (ex. tBTCUSD)
    //
    //    {
    //        'result': [
    //            SYMBOL,
    //            BID,
    //            BID_SIZE,
    //            ASK,
    //            ASK_SIZE,
    //            DAILY_CHANGE,
    //            DAILY_CHANGE_RELATIVE,
    //            LAST_PRICE,
    //            VOLUME,
    //            HIGH,
    //            LOW
    //        ]
    //    }
    //
    //
    // on funding currencies (ex. fUSD)
    //
    //    {
    //        'result': [
    //            SYMBOL,
    //            FRR,
    //            BID,
    //            BID_PERIOD,
    //            BID_SIZE,
    //            ASK,
    //            ASK_PERIOD,
    //            ASK_SIZE,
    //            DAILY_CHANGE,
    //            DAILY_CHANGE_RELATIVE,
    //            LAST_PRICE,
    //            VOLUME,
    //            HIGH,
    //            LOW,
    //            _PLACEHOLDER,
    //            _PLACEHOLDER,
    //            FRR_AMOUNT_AVAILABLE
    //        ]
    //    }
    //
    market := GetArg(optionalArgs, 0, nil)
    _ = market
    var result interface{} = this.SafeList(ticker, "result")
